// import { Container, Row, Col } from "react-bootstrap";
import { Link } from "react-router-dom";
// import Navbar from "../../Navbar/Navbar";
import Box from "@mui/material/Box";
import Typography from "@mui/material/Typography";
import Grid from "@mui/material/Grid";
import Button from "@mui/material/Button";
import * as React from "react";
import PropTypes from "prop-types";
import AppBar from "@mui/material/AppBar";
import Toolbar from "@mui/material/Toolbar";
import CssBaseline from "@mui/material/CssBaseline";
import useScrollTrigger from "@mui/material/useScrollTrigger";
import Container from "@mui/material/Container";
import Fab from "@mui/material/Fab";
import KeyboardArrowUpIcon from "@mui/icons-material/KeyboardArrowUp";
import Zoom from "@mui/material/Zoom";
import Tabs from "@mui/material/Tabs";
import Tab from "@mui/material/Tab";

import "./Home.css";
import Navbar from "../../Navbar";

import headerImg from "../../../img/header-img.png";
import headerLogo from "../../../img/header-logo.png";
import logo from "../../../img/logo.png";
import { display } from "@mui/system";
import Features from "../Features";
import Footer from "../../Footer";

export default function Home() {
  return (
    <>
      <React.Fragment>
        <CssBaseline />
        <Toolbar id="back-to-top-anchor" />
        <Grid container spacing={2} sx={{ marginTop: "140px" }}>
          <Grid xs={6}>
            <img src={headerLogo} alt="" className="header-logo"></img>
            <h3 className="header-h3">
              Quickly and Easily Discover Developers Like You, Connect With Your
              Ideal Teammates and Coding Better Together.
            </h3>
            <Button
              type="submit"
              variant="contained"
              underline="none"
              sx={{
                ":hover": {
                  bgcolor: "#e4a300",
                },
                mt: 3,
                mb: 2,
                backgroundColor: "#FFB703",
                marginLeft: "200px",
              }}
            >
              <Link
                to="/signup"
                style={{ color: "white", textDecoration: "none" }}
              >
                Sign up
              </Link>
            </Button>
            <Button
              type="submit"
              variant="contained"
              sx={{
                mt: 3,
                mb: 2,
                marginLeft: "15px",
                backgroundColor: "#00468B",
                ":hover": {
                  bgcolor: "#00366b",
                },
              }}
              onClick={() => {}}
            >
              <Link
                to="#signup"
                style={{ color: "white", textDecoration: "none" }}
              >
                What is Devteams
              </Link>
            </Button>
            <p className="header-p">
              Already a member?
              <Link to="/signin" className="header-link">
                Log in here
              </Link>
            </p>
          </Grid>

          <Grid xs={6}>
            <img src={headerImg} alt="" className="header-img"></img>
          </Grid>
        </Grid>

        <Grid container spacing={2} sx={{ marginTop: "100px" }}></Grid>

        <Features />
        <Footer />
      </React.Fragment>
    </>
  );
}
